function handleAnim(element, action, direction, triggerPoint)
{
    var slide = element.id.replace("-animation", "");
    var anim = null;

    if(slide !== undefined && window[slide + 'Anim'] === undefined && window[slide + 'Params'] !== undefined && (slide == "pillar" || slide == "sentinel" || slide == "satellite" || slide == "sentry")) {
        preloadAnimation(slide);
    }

    if(slide == "features")
    {
        anim = window.secureAnim;

        window.secureAnim.visibility = action;
        window.smartAnim.visibility = action;
        window.scalableAnim.visibility = action;
    }
    else if(window[slide + "Anim"] != null)
	{
        anim = window[slide + "Anim"];

        anim.visibility = action;
    } else {
    	return false;
    }

    if((action == "enter" || action == "entered") && anim.isPaused)
	{
	    if(slide == "features")
	    {
	        window.secureAnim.play();
	        window.smartAnim.play();
	        window.scalableAnim.play();
        }
		else
		{
            anim.playSegments([0, anim.totalFrames], true);
            return true;
        }
	}
	else if(((action == "exit" && anim.visibility == "entered") || action == "exited") && !anim.isPaused)
    {
        if(slide == "features")
        {
            window.secureAnim.stop();
            window.smartAnim.stop();
            window.scalableAnim.stop();
        }
        else
		{
            anim.stop();
            return true;
        }
    }

	return false;
}

